import Foundation

#if swift(>=3.0)

if let base: Int = Int(ProcessInfo.processInfo.environment["KMVAR_tsc__Representation"]!) {
	let type = ProcessInfo.processInfo.environment["KMVAR_tsc__Type"]!
	var date: Int! = 1

	switch type {
		case "Unix":
			date = Int(Date().timeIntervalSince1970)
		default:
			date = Int(Date().timeIntervalSinceReferenceDate)
	}

	print(String(date, radix: base), terminator: "")
} else {

print("Expected integer!")
}

#else

if let base: Int = Int(NSProcessInfo.processInfo().environment["KMVAR_tsc__Representation"]!) {
	let type = NSProcessInfo.processInfo().environment["KMVAR_tsc__Type"]!
	var date: Int! = 1

	switch type {
		case "Unix":
			date = Int(NSDate().timeIntervalSince1970)
		default:
			date = Int(NSDate().timeIntervalSinceReferenceDate)
	}

	print(String(date, radix: base), terminator: "")
} else {

print("Expected integer!")
}
#endif
